class App extends React.Component{

  render(){
    const args = [
      { nama:"Hadie",
      pekerjaan:"Programmer",
      hobi:"Menulis"},

    ];

    const content = args.map((item,index) =>
    <div key={index}>
       <p>Nama : {item.nama}</p>
      <p>Pekerjaan: {item.pekerjaan}</p>
      <p>{item.hobi}</p>
    </div>
  );

      return (
    <div className="App">
      <h1>List Data Pribadi</h1>
      {content}
    </div>
  );
  }
}

export default App;
